import React from "react";
import styles from "./Tags.module.css";

const formatTags = (tag, i) => (i ? `/${tag}` : tag);

const Tags = ({ children }) => {
  return (
    <div className={styles.tags}>
      {children && children.map(formatTags).map(tag => <span>{tag}</span>)})}
    </div>
  );
};

export default Tags;
